import React, { Component } from 'react'
import { connect } from 'react-redux';
import { nextWizardStep } from '../../../redux/actions/wizardActions';


import {
    Row,
    Col,
    Image
} from 'react-bootstrap';


export const WizardConfig = (props) => {
    return (
        <Row className="d-flex mt-5">  
            <Col lg={1} />
    
            <Col className="d-flex flex-column wizard-pages-container" style={{backgroundColor: 'white'}}>

                <Row>
                    <Col lg={6} style={{backgroundColor: 'red'}}>
                        <Col className="p-5">
                            <Row className="d-flex" style={{backgroundColor: 'yellow'}}>
                                <p className="mr-auto" className="wizard-config-intent-title">Select Intents</p>
                            </Row>
                            
                        
                        </Col>
                    </Col>

                    <Col style={{backgroundColor: 'blue'}} />
                </Row>
    
            </Col>
    
            <Col lg={1} />
        </Row>
        )
}

const mapStateToProps = (state) => ({
    wizardStep: state.wizardR.wizardStep,
})

export default connect(mapStateToProps, {nextWizardStep})(WizardConfig)
